  <body>
    <script  async defer>
      /**
      * @param {string} s
      * @return {number}
      */
      var titleToNumber = function(s) {
          var result = 0;
          for (var i = 0; i < s.length; i++) {
              var num = s[i].charCodeAt() - 64;
              result = result * 26 + num
          }
          return result;
      };      
    </script>
  </body>
